import React from 'react';
import { Link, NavLink } from 'react-router-dom';
import './nav.scss';

function Nav() {


    return (
        <nav>
            <div className="container">
                <div className="logo">
                    <h1>Logo</h1>
                </div>
                <div className="navBars">
                    <h1 class="logo"><a href="#">Brand</a></h1>
                </div>
                <div className="navMenu">
                    <li>Home</li>
                    <li>About</li>

                </div>
            </div>


        </nav>
    )
}

export default Nav;
